import logo from './logo.svg';
import './App.css';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';

import {RevisionPage} from "./componenets/RevisionPage";



function App() {
  return (
    <Router>
      <div className="App" >
        <Navbar bg="dark" variant="dark">
          <Container>
            <Navbar.Brand href="/">Mechanics Journal</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/TestPage">Test</Nav.Link>
              <Nav.Link href="/RevisionPage">Revision</Nav.Link>
              <Nav.Link href="/About">About</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
        <Routes>
          <Route path='/' element={<Content></Content>}></Route>
          <Route path='/TestPage' element={<TestPage></TestPage>}></Route>
          <Route path='/AddJob' element={<AddJob></AddJob>}></Route>
          <Route path='/RevisionPage' element={<RevisionPage></RevisionPage>}></Route>
          {/* <Route path='/UpdateJob/:id' element={<UpdateJob></UpdateJob>}></Route> */}
        </Routes>
        {/* <Header></Header>
    <Content></Content>
    <Footer></Footer> */}
      </div>
    </Router>
  );
}


export default App;
